import React, { useEffect, useState } from 'react';
import { useSelector, useDispatch } from "react-redux";
import { Link } from 'react-router-dom';
import classes from './Search.module.css';
import header_logo from './東大金融研究会_ロゴ.png';
import footer_logo from './東大金融研究会_ロゴ_footer.png';


import {
    selectSheet,
    getSpredSheet,
} from "../company/companySlice";


const Search = () => {
    const dispatch = useDispatch();
    const sheet = useSelector(selectSheet);

    useEffect(async() => {
        const res = await dispatch(getSpredSheet())
    }, []);

    return (
        <div>
            <header>
                <img src={header_logo} className={classes.logo}/>
            </header>
            {sheet.info.elements.map((each_info) => (
                <Link to={`/company/${each_info.ローマ字}/`}　style={{ textDecoration: 'none', color: '#424242' }}>
                    <span className={classes.company_box}>
                        <span className={classes.company_font}>{each_info.企業名}</span>
                        <br/>
                    </span>
                </Link>
            ))}
            <footer>
            <img src={footer_logo} className={classes.logo}/>
            </footer>
        </div>
    )
}

export default Search
